constexpr int MAX_SZ = (1 << 18);
array<int, MAX_SZ> t_;

class SegTree { // Дерево отрезков на максимум
public:
  explicit SegTree(const vector<int>& a) {
    while (size_ < int(a.size())) size_ <<= 1;
    fill(t_.begin(), t_.begin() + size_ * 2, 0);
    Init(a);
  }
  int GetMax(int l, int r) const {
    return GetMax(l, r, 1, 0, size_);
  }
  void Set(int i, int v) {
    Set(i, v, 1, 0, size_);
  }
private:
  int size_ = 1;
  void Init(const vector<int>& a) {
    copy(a.begin(), a.end(), t_.begin() + size_);
    for (auto x = size_ - 1; x >= 1; --x) {
      t_[x] = max(t_[(x<<1)], t_[(x<<1)|1]);
    }
  }
  int GetMax(int l, int r, int x, int lx, int rx) const {
    if (rx <= l || lx >= r) return 0;
    if (rx <= r && lx >= l) return t_[x];
    const auto m = (lx + rx) >> 1;
    return max(GetMax(l, r, (x<<1), lx, m), GetMax(l, r, (x<<1)|1, m, rx));
  }
  void Set(int i, int v, int x, int lx, int rx) {
    if (lx + 1 == rx) {
      t_[x] = v;
      return;
    }
    const auto m = (lx + rx) >> 1;
    if (i < m) Set(i, v, (x<<1), lx, m);
    else Set(i, v, (x<<1)|1, m, rx);
    t_[x] = max(t_[(x<<1)], t_[(x<<1)|1]);
  }
};

class Solution {
public:
  int numOfUnplacedFruits(const vector<int>& fruits, const vector<int>& baskets) {
    const int n = fruits.size();
    SegTree seg_tree(baskets);
    auto unplaced = 0;
    for (auto fi = 0; fi < n; ++fi) {
      const auto f = fruits[fi];
      if (seg_tree.GetMax(0, n) < f) {
        ++unplaced;
      } else {
        auto lo = 0, hi = n - 1;
        while (lo < hi) {
          const auto mi = (lo + hi) >> 1;
          if (seg_tree.GetMax(0, mi + 1) >= f) hi = mi;
          else lo = mi + 1;
        }
        seg_tree.Set(lo, 0);
      }
    }
    return unplaced;
  }
};

